import React, { useState, useEffect } from "react";
import axios from "axios";

export default function App() {
  const [businessData, setBusinessData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [filterName, setFilterName] = useState("");
  const [filterCity, setFilterCity] = useState("");
  const [filterState, setFilterState] = useState("");
  const [filterCategories, setFilterCategories] = useState("");
  const [selectedFilter, setSelectedFilter] = useState("name"); // Default filter
  const [filterChips, setFilterChips] = useState([]);
  const pageSize = 25;

  const handleFilterChange = (event) => {
    setSelectedFilter(event.target.value);
  };

  const addFilter = (value) => {
    if (value.trim() !== "") {
      setFilterChips((prevChips) => [
        ...prevChips,
        { key: prevChips.length, label: `${selectedFilter}: ${value}` },
      ]);
      clearFilterInputs();
    }
  };

  const removeFilter = (chipKey) => {
    setFilterChips((prevChips) =>
      prevChips.filter((chip) => chip.key !== chipKey)
    );
  };

  const clearFilterInputs = () => {
    setFilterName("");
    setFilterCity("");
    setFilterState("");
    setFilterCategories("");
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          `http://localhost:3001/api/data?page=${currentPage}&pageSize=${pageSize}&filterName=${filterName}&filterCity=${filterCity}&filterState=${filterState}&filterCategories=${filterCategories}`
        );
        setBusinessData(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [currentPage, filterName, filterCity, filterState, filterCategories]);

  useEffect(() => {
    const filterString = filterChips
      .map((chip) => chip.label.split(":")[1].trim())
      .join("&");
    setFilterCategories(filterString);
  }, [filterChips]);

  return (
    <div className="p-3">
      <div className="mb-3">
        <Select value={selectedFilter} onChange={handleFilterChange}>
          <MenuItem value="name">Name</MenuItem>
          <MenuItem value="city">City</MenuItem>
          <MenuItem value="state">State</MenuItem>
          <MenuItem value="categories">Categories</MenuItem>
        </Select>
        <TextField
          id="filterText"
          label={`Filter by ${selectedFilter}`}
          variant="outlined"
          value={
            selectedFilter === "name"
              ? filterName
              : selectedFilter === "city"
              ? filterCity
              : selectedFilter === "state"
              ? filterState
              : filterCategories
          }
          onChange={(e) =>
            selectedFilter === "name"
              ? setFilterName(e.target.value)
              : selectedFilter === "city"
              ? setFilterCity(e.target.value)
              : selectedFilter === "state"
              ? setFilterState(e.target.value)
              : setFilterCategories(e.target.value)
          }
        />
        <Button onClick={() => addFilter(filterCategories)}>Add Filter</Button>
      </div>

      <div className="mb-3">
        {filterChips.map((chip) => (
          <Chip
            key={chip.key}
            label={chip.label}
            onDelete={() => removeFilter(chip.key)}
          />
        ))}
      </div>

      <table className="table table-striped">
        <thead>
          <tr>
            <th scope="col">business_id</th>
            <th scope="col">name</th>
            <th scope="col">address</th>
            <th scope="col">city</th>
            <th scope="col">state</th>
            <th scope="col">postal_code</th>
            <th scope="col">stars</th>
            <th scope="col">review_count</th>
            <th scope="col">is_open</th>
            <th scope="col">categories</th>
          </tr>
        </thead>
        <tbody>
          {businessData.map((business) => (
            <tr key={business.business_id}>
              <td>{business.business_id}</td>
              <td>{business.name}</td>
              <td>{business.address}</td>
              <td>{business.city}</td>
              <td>{business.state}</td>
              <td>{business.postal_code}</td>
              <td>{business.stars}</td>
              <td>{business.review_count}</td>
              <td>{business.is_open}</td>
              <td>{business.categories}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <div class="d-flex justify-content-between align-items-center mb-3">
        <button
          class="btn btn-primary"
          onClick={() =>
            setCurrentPage((prevPage) => Math.max(prevPage - 1, 1))
          }
          disabled={currentPage === 1}
        >
          Previous Page
        </button>
        <span class="h5"> Page {currentPage} </span>
        <button
          class="btn btn-primary"
          onClick={() => setCurrentPage((prevPage) => prevPage + 1)}
        >
          Next Page
        </button>
      </div>
    </div>
  );
}
